import styled from 'styled-components';

const StyledShade = styled.div`
    height: 100vw;
    width: 100vw;
    z-index: 8;
    background: rgba(0, 0, 0, .5);
    position: absolute;
    left: 0;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const StyledModalWrapper = styled.div`

`;

const Modal = ({ children }) => {
    return (
        <StyledShade>
            <StyledModalWrapper>

            </StyledModalWrapper>
        </StyledShade>
    )
}

export default Modal;
